Information
------------------------------

Bi-Curious Me
With increasingly open attitudes to sexuality, for women, in particular, interest in same-sex relationships and 'bi-curiosity' are becoming more acceptable. This film explores the stories of three women as they come to terms with changes in their sexuality and questions whether our new-found sexual freedoms make the business of intimate relationships any easier. Dating Coach Hayley Quinn, who's 26, began to explore her own sexuality, prompted by her first partner's open attitude to sex and relationships. A recent partner holds a special place in heart however, and she meets him halfway across the world, but still takes her girlfriend with her. Hayley's approach to sexuality brings a whole new meaning to the phrase 'complicated love life', but is she happier?

